import React from "react";
import '../styles/about.css';
import anchorIcon from "../resource/anchor.png"
import {aboutContentData} from "../actions/aboutAC";
import {connect} from "react-redux"
import {Link} from "react-scroll";
class About extends React.Component{
    componentDidMount() {
        this.props.fetchData("http://localhost/backend/about.php");
    }

    render(){
    return(
        <div className="aboutContent" id="about">
            <img src={anchorIcon} alt="Anchor"/>
            <h1>{this.props.aboutContent.h1}</h1>
            <Link
                activeClass="pasive"
                to="work"
                smooth={true}
                offset={-270}
                duration={500}
            >OUR WORK</Link>
        </div>
    )}
}
const mapStateToProps = state => ({
    aboutContent: state.about
});

const mapDispatchToProps = dispatch => ({
    fetchData: url => dispatch(aboutContentData(url))
});
export default connect(mapStateToProps, mapDispatchToProps)(About)
